script: |
  super -f tsv -I q8984.sql | sort > q8984.out

vector: true

inputs:
  - name: q8984.sql
    data: |
      SELECT DISTINCT * FROM tab1 WHERE NOT col2 BETWEEN - col2 AND - CAST ( 3 AS INTEGER ) / - CAST ( - col2 * + col0 + col0 / col0 AS INTEGER ) + col1;
  - name: tab1

outputs:
  - name: q8984.out
    data: |
      51	14	96
      85	5	59
      91	47	68
